function sendEmail() {
    var a = document.createElement("a"), b = $('input[name="name"]').val();
    a.target = "_blank", a.href = "mailto:info@frontlinefit.com?subject=Biosig results from " + b + "&body=My results where " + encodeURIComponent($("form").serialize()), 
    a.click();
}

$(".do-submitBioSig").on("click", function(a) {
    a.preventDefault(), getContent();
}), $(".do-sendForm").on("click", function(a) {
    a.preventDefault(), sendEmail();
});

var getContent = function() {
    console.log("get content");
    for (var a = $("input").val().replace(new RegExp("=", "g"), "").split("&"), b = [], c = {}, d = 0; d < a.length; d++) {
        var e = a[d];
        if (c[e] = !0, window.bioSigData.answers[e]) {
            if (window.bioSigData.answers[e].sectionContent) {
                var f = window.bioSigData.sectionContent[window.bioSigData.answers[e].sectionContent] + "<br>";
                -1 == b.indexOf(f) && "" != f && b.push(f);
            }
            if (window.bioSigData.answers[e].content) {
                var f = window.bioSigData.content[window.bioSigData.answers[e].content] + "<br>";
                -1 == b.indexOf(f) && "" != f && b.push(f);
            }
            if (window.bioSigData.answers[e].pairs) {
                var g = window.bioSigData.answers[e].pairs;
                for (var h in g) $.each(window.bioSigData.answers[e].pairs[h], function(a, d) {
                    var e = window.bioSigData.content[h] + "<br>";
                    c[d] && -1 == b.indexOf(e) && "" != f && b.push(e);
                });
            }
        }
    }
    $("form").hide(), $("#do-bioSigOutput").html(b);
};